@SafeVarargs
public final <T> Iterable<T> shuffle(T...values) {
  final List<T> asList = new ArrayList<T>(values.length);
  for (T value : values) {
    asList.add(value);
  }
  Collections.shuffle(asList, random());
  return asList;
}

